import React from "react";
import ReactDOM from "react-dom";
import Parallax from "react-springy-parallax";
import "./index.css";
import PreBenchImg from "./images/PreBench.png";

class HomeScreen extends React.Component {
  render() {
    const styles = {
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    };
    return (
      <div>
        <Parallax ref="parallax" pages={3}>
          {/* Backgrounds */}
          <Parallax.Layer
            offset={0}
            speed={1}
            style={{
              backgroundImage: "url(" + PreBenchImg + ")",
              backgroundSize: "cover",
              backgroundPosition: "center",
              backgroundRepeat: "no-repeat",
            }}
          />
          <Parallax.Layer
            offset={1}
            speed={1}
            style={{ backgroundColor: "#243B4a" }}
          ></Parallax.Layer>

          <Parallax.Layer
            offset={2}
            speed={1}
            style={{ backgroundColor: "#243BFF" }}
          ></Parallax.Layer>
          {/* Content */}
          <Parallax.Layer offset={0.25} speed={0.5}>
            Hi I'm Patrick
          </Parallax.Layer>
        </Parallax>
      </div>
    );
  }
}

ReactDOM.render(<HomeScreen />, document.getElementById("root"));
